-- 导出  表 exam1.exam 结构
CREATE TABLE IF NOT EXISTS `exam` (
  `id` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '考试表的主键',
  `name` varchar(128) COLLATE utf8_bin NOT NULL COMMENT '考试名称',
  `avatar` longtext COLLATE utf8_bin COMMENT '考试的预览图',
  `description` varchar(256) COLLATE utf8_bin DEFAULT NULL COMMENT '考试描述',
  `question_ids` varchar(2048) COLLATE utf8_bin DEFAULT NULL COMMENT '当前考试下的题目的id用-连在一起地字符串',
  `question_ids_radio` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '当前考试下的题目单选题的id用-连在一起地字符串',
  `question_ids_check` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '当前考试下的题目多选题的id用-连在一起地字符串',
  `question_ids_judge` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '当前考试下的题目判断题的id用-连在一起地字符串',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '当前考试的总分数',
  `score_radio` int(11) NOT NULL DEFAULT '0' COMMENT '当前考试每个单选题的分数',
  `score_check` int(11) NOT NULL DEFAULT '0' COMMENT '当前考试每个多选题的分数',
  `score_judge` int(11) NOT NULL DEFAULT '0' COMMENT '当前考试每个判断题的分数',
  `creator_id` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '考试创建者的用户id',
  `time_limit` int(11) NOT NULL DEFAULT '0' COMMENT '考试的时间限制，单位为分钟',
  `start_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '考试有效期开始时间',
  `end_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '考试有效期结束时间',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='考试的详细信息表';

