-- 导出  表 exam1.question 结构
CREATE TABLE IF NOT EXISTS `question` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '题目的主键',
  `name` longtext COLLATE utf8_bin COMMENT '题目的名字',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '题目的分数',
  `creator_id` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '题目创建者的用户id',
  `level_id` int(11) NOT NULL DEFAULT '0' COMMENT '题目难易度级别',
  `type_id` int(11) NOT NULL DEFAULT '0' COMMENT '题目的类型，比如单选、多选、判断等',
  `category_id` int(11) NOT NULL DEFAULT '0' COMMENT '题目的类型，比如数学、英语、政治等',
  `description` longtext COLLATE utf8_bin COMMENT '题目额外的描述',
  `option_ids` varchar(1024) COLLATE utf8_bin NOT NULL COMMENT '题目的选项，用选项的id用-连在一起表示答案',
  `answer_option_ids` varchar(1024) COLLATE utf8_bin NOT NULL COMMENT '题目的答案，用选项的id用-连在一起表示答案',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
